import { PipelineToolbar } from './toolbar';
import { PipelineUI } from './ui';
import { SubmitButton } from './submit';
import { TooltipProvider } from './components/ui/tooltip';

function App() {
  return (
    <TooltipProvider>
      <div className="h-screen flex flex-col bg-gray-50">
        {/* Header */}
        <header className="flex-shrink-0 h-12 flex items-center justify-between px-4 bg-white border-b border-gray-200">
          <div className="flex items-center gap-2">
            <span className="text-sm font-semibold text-gray-800">Pipeline Builder</span>
            <span className="text-xs text-gray-400">|</span>
            <span className="text-xs text-gray-500">Untitled Pipeline</span>
          </div>
          <SubmitButton />
        </header>

        {/* Toolbar */}
        <PipelineToolbar />

        {/* Main canvas area */}
        <main className="flex-1 overflow-hidden">
          <PipelineUI />
        </main>
      </div>
    </TooltipProvider>
  );
}

export default App;
